import React from 'react';
import PropTypes from 'prop-types';
import { Button } from 'react-bootstrap';


function Score(props) {

 // console.log(props.score) 
 let text 

      if (props.score==='3.0') {

        text = <div className='SurveyIntroText'>
                <p><span class = "bold">Impressive!</span> You helpt us collect more treasures than our best robot!<span class = "bold">3.0 &#163;</span> in addition to your regular payment!</p>
                </div>

      return (
        <div>
        <center> 
        <div className="instructionsButtonContainer">
          <div>
            {text}           
          </div> 
            <center>
            <Button className="buttonStart" onClick={()=>props.onClicked()}>
            START
            </Button>
            </center>
          </div>
          </center>
          </div>);
      }
      else if (props.score==='1.5') {

        text = <div className='SurveyIntroText'>
                <p><span class = "bold">Well done!</span> You helpt us collect as many treasures as our best robot !<span class = "bold">1.5 &#163;</span> in addition to your regular payment!</p>
                </div>


        return (
        <div>
        <center> 
        <div className="instructionsButtonContainer">
          <div>
            {text}           
          </div> 
            <center>
            <Button className="buttonStart" onClick={()=>props.onClicked()}>
            START
            </Button>
            </center>
          </div>
          </center>
          </div>);
    }
      else {

        text = <div className='SurveyIntroText'>
                <p><span class = "bold">Thank you! You helpt us collect the tresures!</span></p>
                </div>

        return (
        <div>
        <center> 
        <div className="instructionsButtonContainer">
          <div>
            {text}           
          </div>
        </div>  
        </center> 
        {setTimeout(props.onClicked(),1500)}
        </div>);
      }
  }

Score.propTypes = {
  score: PropTypes.string.isRequired,
  onClicked: PropTypes.func.isRequired
};

export default Score;
